      description: "Description goes here",
       // Xbox
       platform1: <a href="https://www.xbox.com/en-au/games/store/rugby-challenge-4/9p3qwt95fmhq" class="platformLogo"><img width='50px' height='50px' src="../images/platform/Xbox.png"/></a>,
