       platform2: <a href="https://store.playstation.com/en-au/product/EP4116-CUSA16106_00-RUCHALLENGE4SIEE/" class="platformLogo"><img width='60px' height='50px' src="../images/platform/Playstation.png"/></a>,
      //Steam
       platform3: <a href="https://www.xbox.com/en-au/games/store/rugby-challenge-4/9p3qwt95fmhq" class="platformLogo"><img width='50px' height='50px' src="../images/platform/Steam.png"/></a>,
      //Switch
      platform4: <a href="https://www.xbox.com/en-au/games/store/rugby-challenge-4/9p3qwt95fmhq" class="platformLogo"><img width='50px' height='50px' src="../images/platform/Nintendo.png"/> </a>
    },
    {
      id: 2,
