      platform4: <a href="https://www.nintendo.com.au/games/nintendo-switch/ty-the-tasmanian-tiger-2-bush-rescue-hd" class="platformLogo"><img width='50px' height='50px' src="../images/platform/Nintendo.png"/></a>
